import React from 'react';
import './cart.css'



const Cart = ({boardgame}) => {
  return ( 
    <div className='cart-item'>
      <img className='cart-img' src={boardgame.image}/>
      <h3 className='cart-name'>{boardgame.name}</h3>
      <button onClick={()=> boardgame.subtractFromCart(boardgame.id)}>-</button>
      <p className='cart-qty'>{boardgame.quantity}</p>
      <button onClick={()=> boardgame.addToCart(boardgame.id)}>+</button>
      <p className='cart-price'>
        <span>${boardgame.price * boardgame.quantity}</span>
      </p>
      <button id='x' onClick={()=> boardgame.removeFromCart(boardgame.id)}>X</button>
  </div>
   );
}

export default Cart;
